import React, {Component} from 'react'
import logoimg from '../img/logo.svg'
import 'bootstrap/dist/css/bootstrap.min.css'

class AddTeacherBtn extends Component {
    render() {
        return (
            <div className="row">
                <div className="col-xl-1 col-md-3 col-sm-5 col-6" style={logoStyle}>
                    <button type="button" className="btn btn-dark btn-lg" style={tbtn}>Відправити</button>
                </div>
            </div>
        )
    }
}
const logoStyle = {
    position: 'fixed',
    bottom: '0',
    left: '0',
    paddingTop: '3px',
    margin: '10px',
}
const tbtn = {
    width: '100%'
}
export default AddTeacherBtn
